import React, { useEffect } from "react";
import { connect } from "react-redux";
import { fetchUsers } from "../redux/players/playerActions";
import { images } from "./images/images";
function Leaderboard({ userData, fetchUsers }) {
  useEffect(() => {
    fetchUsers();
  }, []);

  return userData.loading ? (
    <h2 className="h-screen bg-gray-900 flex justify-center items-center pt-10">
      loading...
    </h2>
  ) : userData.error ? (
    <h2>{userData.error}</h2>
  ) : (
    <div>
      <div className="pt-20 text-white text-lg bg-gray-900 text-center">
        LEADERBOARD
      </div>
      <div className="bg-gray-900 text-white flex justify-center items-center ">
        <div className="pt-10">
          {userData &&
            userData.users &&
            userData.users.map((element, key) => {
              return (
                <div>
                  <img src={images[7]} alt="hangmanlogo" />
                  <div
                    key={key}
                    className="mt-5 p-5 rounded-10 border-2 border-solid border-bg-white"
                  >
                    <div className="text-yellow-500">
                      USERNAME:{" "}
                      <span className="text-white">{element.userName}</span>
                    </div>
                    <div className="text-yellow-500">
                      DURATION:{" "}
                      <span className="text-white">
                        {Math.round(element.duration / 1000)}
                      </span>
                    </div>
                    <div className="text-yellow-500">
                      LENGTH:{" "}
                      <span className="text-white">{element.length}</span>
                    </div>
                    <div className="text-yellow-500">
                      QUOTEID:{" "}
                      <span className="text-white">{element.quoteId} </span>
                    </div>
                    <div className="text-yellow-500">
                      UNIQUE CHARACTERS:{" "}
                      <span className="text-white">
                        {element.uniqueCharacters}
                      </span>
                    </div>
                  </div>
                </div>
              );
            })}
        </div>
      </div>
    </div>
  );
}

const mapStateToProps = (state) => {
  return {
    userData: state.player,
  };
};
const mapDispatchToProps = (dispatch) => {
  return {
    fetchUsers: () => dispatch(fetchUsers()),
  };
};
export default connect(mapStateToProps, mapDispatchToProps)(Leaderboard);

